import styles from '../styles/scss/dashboard-menu.module.scss';
import Profile from './Profile';
import DashboardMenuItem from './DashboardMenuItem';
import { useRouter } from 'next/router';

const DashboardMenu = () => {
	const router = useRouter();

	useEffect(() => {
		const curRoute = router.route;
		const currentPage = curRoute.split('/')[1];
	}, []);

	return (
		<div className={styles.dashboardMenuContainer}>
			<div className={styles.divProfile}>
				<Profile />
			</div>
			<div className={styles.dashboardMenuItems}>
				<DashboardMenuItem menuTitle={'Home'} menuItemFontAwesomeRef={'home'} menuLinkReference={'/'} />
				<DashboardMenuItem menuTitle={'Workflows'} menuItemFontAwesomeRef={'sitemap'} menuLinkReference={'/'} />
				<DashboardMenuItem
					menuTitle={'Shared with me'}
					menuItemFontAwesomeRef={'share-alt'}
					menuLinkReference={'/'}
				/>
				<DashboardMenuItem menuTitle={'Starred'} menuItemFontAwesomeRef={'star'} menuLinkReference={'/'} />
				<DashboardMenuItem
					menuTitle={'Statistics'}
					menuItemFontAwesomeRef={'chart-pie'}
					menuLinkReference={'/'}
				/>
				<DashboardMenuItem menuTitle={'Profile'} menuItemFontAwesomeRef={'user-alt'} menuLinkReference={'/'} />
			</div>
			<div className={styles.summaryStats}>
				<p>
					<span className={styles.workflowTitle}>Workflows</span>
					<br />
					<span className={styles.numWorkflows}>5</span>
				</p>
				<img src="/images/worflow_images.png" alt="Workflows" />
			</div>
		</div>
	);
};

export default DashboardMenu;
